import React from "react";
import './index.css';
import { QRCode } from 'antd';
import logo from '../../assets/images/logo-black1.png';

export default function MyFooter(){

    return(
        <div className="foot">
               <div className="footerAbout">
                    <div className="footerLogo">                   
                        <img src={logo} style={{width:'100%'}}/>
                    </div>
                    <div className="footerInfos">
                        <span className="child1">隐私和法律</span>
                        <span className="child2">联系我们</span>
                        <span className="child3">环保信息</span>
                        <span className="child4" >查询网</span>
                    </div>
                    <QRCode
                        errorLevel="H"
                      
                        // iconSize={ / 4}
                        value="https://ant.design/"
                        icon="../../assets/images/logo.png"
                    />
                </div> 
               <div className="certificates">       
                  Copyright ©2023 现代进口汽车 现代汽车（中国）投资有限公司版权所有京 ICP 备 10011541-19
               </div>
        </div>
    )
}
